import React from "react";


const content = () => {
  return (
    <div className='txt  font-bold tracking-wide cursor-default leading-tight min-h-[calc(80vh-146px)] pb-20 uppercase flex flex-col gap-4 justify-center items-center select-none'>
      <p className="text-4xl sm:text-5xl md:text-9xl">
        Amine
      </p>
      <p className="text-4xl sm:text-5xl md:text-8xl">
        BenMoussa
      </p>
    </div>
  );
};

export default content;
